import React from "react";



const Bubble_Container = ({userChats}) => {

	return (
		<div>
			<h1><ul>
        {userChats.map((item, index) => (
			<div>

			<div className = 'user-bubble' key={index}>{item[0]}</div>
			<div className = 'response-bubble' key={index}>{item[1]}</div>


			</div>


        ))}
      </ul></h1>


		</div>

	);
};

export default Bubble_Container;
